<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Rosy</title>
    <style>
    body {
        background-color: #060A0E;
        color: #EFF2F6;
        font-family: 'Courier Prime', monospace;
    }

    a {
        text-decoration: none;
        color: inherit;
    }

    .signin {
        display: flex;
        justify-content: center;
        align-items: center;
        height: 30px;
        width: 100px;
        background-color: #027BB7;
        border-radius: 12px;
        font-weight: 400; 
        margin: 20px;
    }

    .contents {
        display: flex;
        justify-content: center;
        align-items: center;
        margin-bottom: 50px;
    }

    .stroke {
            opacity: 20%;
    }

    .text {
        position: absolute;
        display: flex;
        flex-direction: column;
        justify-content: flex-start;
        align-items: flex-start;  
        width: 700px;
        height: auto;

        .top {
            line-height: 1px;  
            
            h1 {
            font-size: 3rem;
            font-weight: 600; 
            }

        }

        .mid {
            
        }

        .bottom {
            color: #027BB7;
        }
    }

    .pdf {
        display: flex;
        justify-content: center;
    }

    .embed {
    width: 80%;
    height: 100vh;
    overflow: auto;
    border: none;
    border-radius: 12px;
    
    }

    .pdf::-webkit-scrollbar {
        display: none;
    }
    </style>
</head>
<body>
    <div class="nav">
        <div class="signin">
            <a href="/"><- HOME</a>
        </div>
    </div>
    <div class="contents">
        <div class="stroke">
            <svg width="927" height="351" viewBox="0 0 1127 351" fill="none" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink">
                <path d="M0 0H1127V351H0V0Z" fill="url(#pattern0_8_15)" fill-opacity="0.7"/>
                <defs>
                <pattern id="pattern0_8_15" patternContentUnits="objectBoundingBox" width="1" height="1">
                <use xlink:href="#image0_8_15" transform="matrix(0.00055457 0 0 0.00178063 -0.0248447 -0.233084)"/>
                </pattern>
                <image id="image0_8_15" width="1920" height="777" xlink:href="data:image/png;base64,"/>
                </defs>
            </svg>
        </div>
        <div class="text">
            <div class="top">
                <h1 class="dynamic-font-size">{{$file->title}}</h1>
                <p>Written By: {{ $file->user->first_name }} {{ $file->user->last_name }}</p>
            </div>
            <div class="mid">
                <p>{{ $file->synopsis }}</p>
            </div>
            <div class="bottom">
                <p>{{ $file->genre }}</p>
            </div>
        </div>
        
    </div>  
    <div class="pdf">
        <embed src="{{ asset('pdfs/' . $file->filename) }}" type="application/pdf" class="embed"/>
    </div>
    <script>
        document.addEventListener('keyup', (e) => {
            navigator.clipboard.writeText('');
            alert('SC Disabled')
        })
    </script>
</body>
</html>
